import React, { useState, useEffect, useRef } from 'react';
import { classNames } from 'primereact/utils';
import { DataTable } from 'primereact/datatable';
import { Column } from 'primereact/column';
import { InputText } from 'primereact/inputtext';
import { Button } from 'primereact/button';
import { Dropdown } from 'primereact/dropdown';
import { Calendar } from 'primereact/calendar';
import { MultiSelect } from 'primereact/multiselect';
import { ProgressBar } from 'primereact/progressbar';

export const SupplierProduct = () => {

    return (
        <div className="datatable-crud">
            <div className="card">
                <DataTable>
                    <Column field="" header={('STT')} sortable filter  />
                    <Column field="" header={('Mã sản phẩm')} sortable filter  />
                    <Column field="" header={('Tên sản phẩm')} sortable filter  />
                    <Column field="" header={('Mã NCC')} sortable filter  />
                    <Column field="" header={('Nhà cung cấp')} sortable filter  />
                    <Column field="" header={('SL tối thiểu')} sortable filter  />
                    <Column field="" header={('Mã đơn vị chính')} sortable filter  />
                    <Column field="" header={('Giá đơn vị mua')} sortable filter  />
                    <Column field="" header={('Đơn vị tiền tệ')} sortable filter  />
                    <Column field="" header={('Từ ngày')} sortable filter  />
                    <Column field="" header={('Tới ngày')} sortable filter  />
                </DataTable>
            </div>
        </div>
    )
}
